import { Component } from '@angular/core';
import { getAllPokemon } from 'src/app/_core/services';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
})
export class HomeComponent {
  data: string = "";
  async setPokemon()  {
    await getAllPokemon().then((res: any) => 
      this.data = res
    ).catch((e)=> console.log(e));
  }
}
